import './App.css';
import React, { useState } from 'react';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import { Button, TextField, Icon, Container } from '@material-ui/core';

function App() {
  const [selectedDate, setSelectedDate] = useState(new Date('2014-08-18T21:11:54'));

  const handleDateChange = (date) => {
    setSelectedDate(date);
  };

  return (
    <Container>
      <form className="InputForm">
        <TextField className="inputName" id="outlined-basic" label="Outlined" variant="outlined" />
        <TextField
          className="inputDate"
          id="date"
          label="Birthday"
          type="date"
          defaultValue="2017-05-24"
          InputLabelProps={{
            shrink: true,
          }}
        />
        <TextField className="inputContext" id="outlined-basic" label="Outlined" variant="outlined" />
        <Button
          variant="contained"
          color="primary"
          className="sendBtn"
          endIcon={<Icon>send</Icon>}
        >
          Send
      </Button>
      </form>
    </Container>
  );
}

export default App;
